import React from 'react';
import Container from 'react-bootstrap/Container';
import { FaShoppingCart } from "react-icons/fa";
import Button from 'react-bootstrap/Button';

const shoppingCart = ({price}) => { 
    return(
        <div>
            <FaShoppingCart/>&nbsp;&nbsp;&nbsp;{"$" + price}
            <br/><br/>
            <Container style={{height: "25px"}}>
                {"Unidades: "}
                <button style={{padding: "3px", borderRadius: "5px", padding: "5px", textAlign: "center"}}>-</button>
                &nbsp;&nbsp;1&nbsp;&nbsp;
                <button style={{padding: "3px", borderRadius: "5px", padding: "5px", textAlign: "center", heigth: "5px"}}>+</button>
                <div>
                    <Button variant="secondary" style={{border: "1px solid white", margin: "5px", position: "relative", top: "5vh", left: "6vw"}}>
                        {"Agregar al carrito"}
                    </Button>
                </div>
            </Container>
        </div>)
}

export default shoppingCart;
